import pdfMake from 'pdfmake/build/pdfmake'
import pdfFonts from 'pdfmake/build/vfs_fonts'

const logo = "data:image/png;base64,"

const excluirTeste = async (uuid) =>{
    console.log(uuid);
        const formData = new FormData();
          formData.append('uuid', uuid);

          let url = 'http://127.0.0.1:5000/testes';
          try {
            const response = await fetch(url, {
              method: 'delete',
              body: formData
            });
        
            const jsonResult = response;
            window.location.reload()
            return jsonResult; // Retornar o resultado para quem chamou a função
          } catch (error) {
            console.error('Error:', error);
            // Tratar ou lançar novamente o erro, conforme necessário
            throw error;
          }
        
}

function mapearParaDescricao(valorNumerico) {
  switch (valorNumerico) {
    case 0:
      return "Não";
    case 1:
      return "Sim";
  }
}

function mapearGeneroParaDescricao(valorNumerico) {
  switch (valorNumerico) {
    case 1:
      return "Mulher";
    case 2:
      return "Homem";
  }
}

function mapearSaudeParaDescricao(valorNumerico) {
  switch (valorNumerico) {
    case 1:
      return "NORMAL";
    case 2:
      return "ACIMA DO NORMAL";
    case 3:
      return "MUITO ACIMA DO NORMAL";
  }
}

const gerarPdf = (data) =>{

  data.active = mapearParaDescricao(data.active);
  data.smoke = mapearParaDescricao(data.smoke)
  data.alco = mapearParaDescricao(data.alco)
  data.cholesterol = mapearSaudeParaDescricao(data.cholesterol)
  data.gluc = mapearSaudeParaDescricao(data.gluc)
  data.gender = mapearGeneroParaDescricao(data.gender)


    pdfMake.vsf = pdfFonts.pdfMake.vsf

    pdfMake.fonts = {
        Roboto: {
            normal: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Regular.ttf',
            bold: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Medium.ttf',
            italics: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Italic.ttf',
            bolditalics: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-MediumItalic.ttf'
          },
      };
    const reportTitle ={
      columns: [
        {
          text: "CardioGuard" + " - Avaliação de doenças CardioVascular",
          alignment: "center",
          style: "header"
        },
        {
          image: logo,
          width: 40,
          alignment: 'center',
          margin: [60, 10]
        }
      ]
    };

    const details =[
      { text: "Exame Médico", style: "header" },
      { text: "Informações do Paciente", style: "subheader" },
      "Idade: " + data.age,
      "Altura: " + data.height  + " cm",
      "Peso: " + data.weight  + " kg",
      "IMC:" + data.imc,
      "Gênero: " + data.gender ,
      { text: "Medições de Pressão Arterial e resultados de Exames", style: "subsubheader" },
      "Pressão Arterial Sistólica: " + data.ap_hi,
      "Pressão Arterial Diastólica: " + data.ap_lo,
      "Colesterol: " + data.cholesterol,
      "Glicose: " + data.gluc ,
      { text: "Estilo de Vida", style: "subsubheader" },
      "Tabagismo: " + data.smoke ,
      "Consumo de Álcool: " + data.alco ,
      "Atividade Física: " + data.active ,
      {text: "------------------------------------------------------------------------------------------------",style: "centersubheader" },
      { text: "Dicas para melhorar a saúde", style: "centersubheader" },
      (data.alco == "Sim") ? "- Se você consome álcool regularmente, considere reduzir sua ingestão para promover a saúde do coração. Limitar o consumo pode ter impactos positivos significativos na prevenção de doenças cardiovasculares." : '',
      (data.smoke == "Sim") ? "- Para reduzir o risco de doenças cardíacas, recomendamos que você pare de fumar imediatamente. Procure apoio profissional e explore métodos eficazes para abandonar esse hábito prejudicial." : '',
      (data.active == "Não") ? "- Integrar atividade física à sua rotina diária é crucial para a saúde cardíaca. Comece com pequenas mudanças, como caminhadas regulares ou exercícios leves. Consulte um profissional de saúde para orientações personalizadas e inicie sua jornada para um coração mais saudável." : '',
      (data.imc !== "NORMAL") ? "- Se o seu IMC está diferente do ideal, considere ajustes na dieta e exercícios para alcançar um peso saudável. Consulte um profissional de saúde para orientações personalizadas." : '',
      (data.imc == "NORMAL" && data.active == "Sim" && data.smoke == "Não" && data.alco == "Não") ? "- Parabéns! Sua dedicação a um estilo de vida saudável é notável. Com um IMC adequado, hábitos que excluem fumar e beber, além da prática regular de atividade física, você está no caminho certo para uma vida plena e saudável. Continue assim e cuide bem de você!" : '',
      {text: "------------------------------------------------------------------------------------------------",style: "centersubheader" },
      { text: "Resultado final", style: "centersubheader" },
      (data.cardio == 1) ?{ text: "Seu resultado sugere uma alta probabilidade de risco para doenças cardíacas. Recomendamos fortemente que consulte um profissional de saúde para uma avaliação mais detalhada. Exames médicos adicionais podem ser necessários para confirmar e receber orientações específicas.", style: "center" } : '',
      (data.cardio == 0) ?{ text: "Parabéns! Seu teste indica uma baixa probabilidade de risco para doenças cardíacas. No entanto, é sempre aconselhável consultar um médico para uma avaliação completa e exames adicionais. Mantenha hábitos saudáveis para garantir a saúde do seu coração a longo prazo.", style: "center" } : '',

    ]

    const style = {
      header: {
        fontSize: 18,
        bold: true,
        margin: [0, 10, 0, 10]
      },
      subheader: {
        fontSize: 16,
        bold: true,
        margin: [0, 10, 0, 5]
      },
      centersubheader: {
        fontSize: 16,
        bold: true,
        margin: [0, 10, 0, 5],
        alignment: "center"
      },
      center: {
        alignment: "center"
      },
      subsubheader: {
        fontSize: 12,
        bold: true,
        margin: [0, 10, 0, 3]
      }}
    const rodape = []

    const docDefinitions = {
        pageSize:'A4',
        pageMargins:[15,50,15,40],
        header:reportTitle,
        content:[details],
        footer:[rodape],
        styles:style
    }

    pdfMake.createPdf(docDefinitions).download()
}

export { excluirTeste, gerarPdf
};